import { FC } from 'react';
import { Route, Routes } from 'react-router-dom';
import Home from './routes/Home';

const App: FC = () => {
  return (
    <Routes>
      <Route exact path='/' element={<Home />}></Route>
    </Routes>
  );
}

export default App;
